import React from "react";
import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";


const Header = () => {

  const [flavors, setFlavors] = React.useState([]);

    React.useEffect( () => {
        fetchData();
    }, []);


    const fetchData = async () => {
        const response = await fetch("http://localhost:5000");
        const items = await response.json();

        setFlavors(items);
        console.log(flavors);
    };



    return (
      <div className="header">
        <Navbar expand="md">
          <Container className="mt-3 mb-3">
            <Nav className="me-auto">
              <NavDropdown title="Flavors" id="basic-nav-dropdown">
                <NavDropdown.Item href="/badam">Badam</NavDropdown.Item>
                <NavDropdown.Item href="/pista">Pista</NavDropdown.Item>
              </NavDropdown>
            </Nav>

            <Navbar.Brand className="navbar-brand" href="/">
              React-Bootstrap
            </Navbar.Brand>

            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="ms-auto">
                <Nav.Link href="/home">Home</Nav.Link>
                <Nav.Link href="/store">Store Locator</Nav.Link>
                <NavDropdown title="About" id="basic-nav-dropdown">
                  <NavDropdown.Item href="/story">Our Story</NavDropdown.Item>
                  <NavDropdown.Item href="/contact">Contact</NavDropdown.Item>
                </NavDropdown>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
      </div>
    );
};


export default Header;
